import React from 'react';

const About = () => {
  return (
    <div className='flex justify-content shadow-lg bg-red-100'>
      <div className='absolute border border-white justify-center'>
        <h1 className=' justify-center my-4'>About</h1>
      </div>
      <div className='grid gap-4 container bg-slate-100 rounded-lg mr-5 my-10 ml-20 shadow-lg'> 
          <h1 className='text-white text-center text-4xl '>Members
            <h1 className='p-3 text-amber-200'>150</h1>
          </h1>
      </div>
      <div className='grid gap-4 container bg-slate-200 rounded-lg ml-60 my-10 mr-20 shadow-lg'>
          <h1 className='text-white text-4xl m-4'></h1>
      </div>
    </div>
  )
}

export default About;
